import Header from './header';
import Footer from './footer';

const BpmHistory = () => {
  


  return (
    <div>
      <Header />
      <div className="container mt-5">
        <br /><br />
        <h2 className="mb-4">BPM History</h2>
        <div className="col">
          
        </div>

        <Line data={chartData} />
        <table className="table table-dark table-striped mt-4" style={{ marginBottom: '10%' }}>
          <thead>
            <tr>
              <th>Average Beat</th>
              <th>Status</th>
              <th>Date</th>
            </tr>
          </thead>
          <tbody>
            {bpm.map((bpmData) => (
              <tr key={bpmData._id}>
                <td>{bpmData.beatAvg}</td>
                <td>{bpmData.beatStatus}</td>
                <td>{new Date(bpmData.timestamp).toDateString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <Footer />
    </div>
  );
};

export default BpmHistory;
